var nodejs = (typeof window === 'undefined');
if (nodejs) {
	var TestMain = require('./main');
	var MNISTLoader = require('../utils/mnist_loader');
	var AgentSmith = require('../agent_smith/src/agent_smith');
	require('../agent_smith/src/agent_smith_cl');
}

var data = null;

var showMatImage = function(mat) {
	var threshold = 0.5;
	for (var y = 0; y < mat.rows; y++) {
		for (var x = 0; x < mat.cols; x++) {
			process.stdout.write((mat.get(y, x) < threshold) ? ' ' : '.');
		}
		console.log('');
	}
}

TestMain.Tester.addTest('LoaderTest', [
	{
		name : 'Load',
		test : function(callback) {
			MNISTLoader.load('../dataset/mnist/train-images-idx3-ubyte', '../dataset/mnist/train-labels-idx1-ubyte', 10, function(tmp_data) {
				data = tmp_data;
				// images
				if (tmp_data.images.length !== 10) {
					callback(false);
					return;
				}
				var correct_images = [
					{"rows":28,"cols":28,"data":"","row_wise":true},
					{"rows":28,"cols":28,"data":"","row_wise":true},
					{"rows":28,"cols":28,"data":"","row_wise":true},
					{"rows":28,"cols":28,"data":"","row_wise":true},
					{"rows":28,"cols":28,"data":"","row_wise":true},
					{"rows":28,"cols":28,"data":"","row_wise":true},
					{"rows":28,"cols":28,"data":"","row_wise":true},
					{"rows":28,"cols":28,"data":"","row_wise":true},
					{"rows":28,"cols":28,"data":"","row_wise":true},
					{"rows":28,"cols":28,"data":"","row_wise":true}
				];
				for (var i = 0; i < tmp_data.images.length; i++) {
					if (!tmp_data.images[i].equals(AgentSmith.Matrix.fromJSON(correct_images[i]))) {
						callback(false);
						return;
					}
				}
				// labels
				if (tmp_data.labels.length !== 10) {
					callback(false);
					return;
				}
				var correct_labels = [ 5, 0, 4, 1, 9, 2, 1, 3, 1, 4 ];
				for (var i = 0; i < tmp_data.labels.length; i++) {
					if (tmp_data.labels[i] != correct_labels[i]) {
						callback(false);
						return;
					}
				}
				
				callback(true);
			});
		}
	},
	{
		name : 'CreateBatches',
		test : function() {
			var batches = MNISTLoader.createBatches(data.images, data.labels, 5);
			// image_batches
			if (batches.image_batches.length !== 2) {
				return false;
			}
			var correct_image_batches = [
				{"rows":5,"cols":784,"data":"","row_wise":true},
				{"rows":5,"cols":784,"data":"","row_wise":true}
			];
			for (var i = 0; i < batches.image_batches.length; i++) {
				if (!batches.image_batches[i].equals(AgentSmith.Matrix.fromJSON(correct_image_batches[i]))) {
					return false;
				}
			}
			// label_batches
			if (batches.label_batches.length !== 2) {
				return false;
			}
			if (!batches.label_batches[0].equals(AgentSmith.Matrix.fromArray([[5], [0], [4], [1], [9]]))) {
				return false;
			}
			if (!batches.label_batches[1].equals(AgentSmith.Matrix.fromArray([[2], [1], [3], [1], [4]]))) {
				return false;
			}
			batches.label_batches[1].print();
			return true;
		}
	},
]);